import React, { useState } from "react";
import "./index.css";

interface guh {
  visible: boolean;
  tabState: number;
}

const Modal = ({ visible, tabState }) => {
  return (
    <div className={{ visible } ? "modalopen" : "modalclosed"}>
      {visible}guh
    </div>
  );
};

export default Modal;
